import React, { Component } from "react";
import { WiThermometer } from "react-icons/wi";
import { MdDashboard } from "react-icons/md";
import { FaMapMarkerAlt } from "react-icons/fa";
import { VscCalendar } from "react-icons/vsc";
import { MdSettings } from "react-icons/md";
import { IoMdStats } from "react-icons/io";

class Amenu extends Component {
  render() {
    return (
      <div className="col-3 amenu ">
        <div className="test ml-3">
          <h5 className="meteoText my-4">
            <WiThermometer className="thermo-size" />
            METEOROLOG
          </h5>
        </div>
        <hr className="hr mb-5" />
        <section className="">
          <div className="test my-2">
            <MdDashboard className="amenu-size  my-2" />
            <p className="ml-3 align-text-bottom">Dashboard</p>
          </div>
          <div className="test ">
            <IoMdStats className="amenu-size" />
            <p className="ml-3">Statistics</p>
          </div>
          <div className="test">
            <FaMapMarkerAlt className="amenu-size" />
            <p className="ml-3">Map</p>
          </div>
          <div className="test">
            <VscCalendar className="amenu-size" />
            <p className="ml-3">Calendar</p>
          </div>
          <div className="test">
            <MdSettings className="amenu-size" />
            <p className="ml-3">Setting</p>
          </div>
        </section>
      </div>
    );
  }
}

export default Amenu;
